  CONSTRAINT `fk_presupuesto_ugen` FOREIGN KEY (`usuario_gen`) REFERENCES `usuario` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1460 DEFAULT CHARSET=latin1;
