/*!50003 DROP FUNCTION IF EXISTS `fn_orden_total_repuestos` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_unicode_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = '' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `fn_orden_total_repuestos`(
	p_orden_id int
) RETURNS decimal(15,2)
BEGIN
	declare total_repuestos decimal(15,2);
    
	select 
			sum(
			case orp.tipo 
				when 0 then cast(valor * cantidad * (1 - z.desc_1 / 100) as decimal(15,2))
				when 1 then cast(valor * cantidad * (1 - z.desc_2 / 100) as decimal(15,2))
                when 2 then cast(valor * cantidad * (1 - z.desc_3 / 100) as decimal(15,2))
				else cast(valor * cantidad * (1 - z.desc_1 / 100) as decimal(15,2))
			end) into total_repuestos
		from orden_repuesto orp
		join orden o on o.id = orp.orden
				join zona z on z.id = o.zona
		where orp.orden = p_orden_id; 
	
RETURN total_repuestos;
END ;;
DELIMITER ;
