/*!50003 DROP PROCEDURE IF EXISTS `sp_cliente_select-list` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_unicode_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = '' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cliente_select-list`(

	in p_user_type int,

	in p_user_id int

)
BEGIN

	if p_user_type = 1 or p_user_type = 4 then

		SELECT `cliente`.`id`,

			`cliente`.`nombre` as `data`

		FROM `cliente`

		where cliente.id in (

			select 

				uc.cliente

			from

				usuario_cliente uc

			where uc.usuario = p_user_id)

		order by 2;

	elseif p_user_type = 2 then

		SELECT `cliente`.`id`,

			`cliente`.`nombre` as `data`

		FROM `cliente`

		where cliente.id in (

			select 

				zct.cliente

			from

				zona_cliente_taller zct

			join usuario_taller ut on ut.taller = zct.taller

			where ut.usuario = p_user_id

			group by zct.cliente)

		order by 2;

	else

		SELECT `cliente`.`id`,

			`cliente`.`nombre` as `data`

		FROM `cliente`

		order by 2;

	end if;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
