/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = latin1 */ ;
/*!50003 SET character_set_results = latin1 */ ;
/*!50003 SET collation_connection  = latin1_swedish_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = '' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cliente_select-range`(
	in p_startpos int, 
	in p_count int,
	in p_filter_field varchar(50),
	in p_filter_value int,
	in p_filter_text varchar(100),
	in p_user_type int,
	in p_user_id int,
	inout o_count int
)
BEGIN
	set @startpos = p_startpos;
	set @count = p_count;
	set @filter_field = p_filter_field;
	set @filter_value = p_filter_value;
	set @filtered = false;
	set @q = o_count;
	set @filter_text = p_filter_text;
	set @user_type = p_user_type;
	set @user_id = p_user_id;
	
	if @q = 1 then
		set @stmnt = "select count(*) into @q from cliente c";
	else
		set @stmnt = "select c.* from cliente c";
		set @q = -1;
	end if;

	if @filter_text != "" then
		if @user_type = 2 then
			set @stmnt = replace(replace(concat(@stmnt, 
				" where c.id in (select 
							zct.cliente
						from
							zona_cliente_taller zct
						join usuario_taller ut on ut.taller = zct.taller
						where ut.usuario = $fuser$
						group by zct.cliente)
				and (c.nombre like '%$ftext$%' 
				or c.descripcion like '%$ftext$%' 
				or c.direccion like '%$ftext$%'
				or c.localidad like '%$ftext$%'
				or c.provincia like '%$ftext$%'
				or c.mail like '%$ftext$%')"), "$ftext$", @filter_text), 
				"$fuser$", @user_id);
		else
			set @stmnt = replace(concat(@stmnt, 
				" where c.nombre like '%$ftext$%' 
				or c.descripcion like '%$ftext$%' 
				or c.direccion like '%$ftext$%'
				or c.localidad like '%$ftext$%'
				or c.provincia like '%$ftext$%'
				or c.mail like '%$ftext$%'"), "$ftext$", @filter_text);
		end if;
	elseif @filter_field != "" and @filter_value != -1 then
		set @filtered = true;
		if @user_type = 2 then
			set @stmnt = concat(@stmnt, replace(
				" where c.id in (select 
							zct.cliente
						from
							zona_cliente_taller zct
						join usuario_taller ut on ut.taller = zct.taller
						where ut.usuario = $fuser$
						group by zct.cliente) and ", "$fuser$", @user_id),
				@filter_field, " = ?");
		else
			set @stmnt = concat(@stmnt, " where ", @filter_field, " = ?");
		end if;
	else
		if @user_type = 2 then
			set @stmnt = concat(@stmnt, replace(
				" where c.id in (select 
							zct.cliente
						from
