CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_novedad_select-range`(
	in p_startpos int, 
	in p_count int,
	in p_filter_field varchar(50),
	in p_filter_value int,
	in p_filter_text varchar(100),
	in p_user_type int,
	in p_user_id int,
	inout o_count int
)
BEGIN
	set @acount = o_count;
	set @filter_text = p_filter_text;
	set @user_type = p_user_type;
	set @user_id = p_user_id;

	if @acount = 1 then	
		set @ttable = "t1";
	else
		set @ttable = "t2";
	end if;

	if p_filter_field = "vehiculo" and p_filter_value != -1 then
		set @stmnt = replace("create temporary table $table$ AS (
			select * from vw_novedad_no_orden n $where$)", "$table$", @ttable);
    else
		set @stmnt = replace("create temporary table $table$ AS (
			select * from vw_novedad n $where$)", "$table$", @ttable);
	end if;
 
	if @filter_text != "" then
		if @user_type = 1 or @user_type = 4 then
			set @stmnt = replace(replace(replace(@stmnt, "$where$", 
				" where n.cliente_id in (select 
								uc.cliente
							from
								usuario_cliente uc
							where uc.usuario = $fuser$)
				and (cliente_nombre like '%$ftext$%'
					or cast(orden as char) like '%$ftext$%'
					or cast(fecha as char) like '%$ftext$%'
					or dominio like '%$ftext$%'
                    or descripcion like '%$ftext$%'
                    or observaciones like '%$ftext$%')"), "$ftext$", @filter_text),
				"$fuser$", @user_id);
		elseif @user_type = 2 then
			set @stmnt = replace(replace(replace(@stmnt, "$where$", 
				" where n.cliente_id in (select 
								zct.cliente
							from
								zona_cliente_taller zct
							join usuario_taller ut on ut.taller = zct.taller
							where ut.usuario = $fuser$
							group by zct.cliente)
				and (cliente_nombre like '%$ftext$%'
					or cast(orden as char) like '%$ftext$%'
					or cast(fecha as char) like '%$ftext$%'
					or dominio like '%$ftext$%'
                    or descripcion like '%$ftext$%'
                    or observaciones like '%$ftext$%')"), "$ftext$", @filter_text),
				"$fuser$", @user_id);
		else
			set @stmnt = replace(replace(@stmnt, "$where$", 
				" where cliente_nombre like '%$ftext$%'
					or cast(orden as char) like '%$ftext$%'
					or cast(fecha as char) like '%$ftext$%'
					or dominio like '%$ftext$%'
					or descripcion like '%$ftext$%'
					or observaciones like '%$ftext$%'"), "$ftext$", @filter_text);
		end if;
	else
		if @user_type = 1 or @user_type = 4 then	
			set @stmnt = replace(replace(@stmnt, "$where$", 
							" where n.cliente_id in (select 
								uc.cliente
							from
								usuario_cliente uc
							where uc.usuario = $fuser$)"), "$fuser$", @user_id);
		elseif @user_type = 2 then	
			set @stmnt = replace(replace(@stmnt, "$where$", 
							" where n.cliente_id in (select 
								zct.cliente
							from
								zona_cliente_taller zct
							join usuario_taller ut on ut.taller = zct.taller
							where ut.usuario = $fuser$
							group by zct.cliente)"), "$fuser$", @user_id);
		else
			set @stmnt = replace(@stmnt, "$where$", "");
		end if;
	end if;
    
    set @stmnt = concat(@stmnt, " order by fecha desc");
    
	prepare new_stmnt from @stmnt;
	execute new_stmnt;
	deallocate prepare new_stmnt;				

	call `sp_table_select-range`(
		@ttable,
		p_startpos,
		p_count,
		p_filter_field,
		p_filter_value,
		@acount);
	
	select @acount into o_count;
END ;;
