	set @stmnt = replace("create temporary table $table$ AS (
		select odn.*, vn.fecha, vn.descripcion, vn.observaciones from orden_novedad odn 
		join vw_novedad vn on vn.id = odn.novedad $where$)", "$table$", @ttable);
 
	if @filter_text != "" then
		set @stmnt = replace(replace(@stmnt, "$where$", 
			" where concat(vn.fecha, ' - ', vn.descripcion) like '%$ftext$%'"), "$ftext$", @filter_text);
	else
		set @stmnt = replace(@stmnt, "$where$", "");
	end if;

	prepare new_stmnt from @stmnt;
	execute new_stmnt;
	deallocate prepare new_stmnt;				

	call `sp_table_select-range`(
		@ttable,
		p_startpos,
		p_count,
		p_filter_field,
		p_filter_value,
		@acount);
	
	select @acount into o_count;
END ;;
