	set @count = p_count;

	set @filter_field = p_filter_field;

	set @filter_value = p_filter_value;

	set @filtered = false;

	set @q = o_count;

	set @filter_text = p_filter_text;

	set @user_type = p_user_type;

	set @user_id = p_user_id;

    

    if @user_type = 1 then

		set @stmnt_p  = "select max(p1.id) from vw_presupuesto p1 where p1.orden = o.id and p1.p_tipo = 2";

        set @stmnt_od = "select max(od1.id) from vw_orden_detalle od1 where\t\r\n\t\t\tod1.orden = o.id and\t\r\n             (od1.estado not in (101,102,202) \r\n\t\t\t  or (od1.estado = 101 and od1.tipo = 3)\r\n              or (od1.estado in (102, 202) and od1.tipo = 1))";

	elseif @user_type = 2 then

		set @stmnt_p = "select max(p1.id) from vw_presupuesto p1 where p1.orden = o.id and p1.p_tipo = 1";

        set @stmnt_od = "select max(od1.id) from vw_orden_detalle od1 where\t\r\n\t\t\tod1.orden = o.id and\t\r\n             (od1.estado not in (101,102,202) \r\n\t\t\t  or (od1.estado = 101 and od1.tipo = 2)\r\n              or (od1.estado in (102, 202) and od1.tipo = 3))";

	else

		set @stmnt_p = "select max(p1.id) from vw_presupuesto p1 where p1.orden = o.id";

        set @stmnt_od = "select max(od1.id) from vw_orden_detalle od1 where od1.orden = o.id";

	end if;

	

	if @q = 1 then

		set @stmnt = replace(replace("select count(*) into @q from orden o\r\n\t\t\tjoin vehiculo v on v.id = o.vehiculo\r\n\t\t\tjoin cliente c on c.id = o.cliente\r\n\t\t\tjoin taller t on t.id = o.taller\r\n\t\t\tjoin marca m on m.id = v.marca\r\n\t\t\tjoin modelo d on d.id = v.modelo\r\n\t\t\tjoin zona z on z.id = o.zona\r\n            left outer join vw_orden_detalle od1 on od1.orden = o.id \r\n\t\t\t\tand od1.estado = 100\r\n            left outer join vw_orden_detalle od on od.orden = o.id\r\n\t\t\t\tand od.id = ($stmnt_od$)\r\n            left outer join vw_presupuesto p on p.orden = o.id\r\n\t\t\t\tand p.id = ($stmnt_p$)\r\n\t\t\tleft outer join estado e on e.id = od.estado", "$stmnt_p$", @stmnt_p), "$stmnt_od$", @stmnt_od);

	else

		set @stmnt = replace(replace("select o.*, m.marca as orden_marca, \r\n\t\t\td.modelo as orden_modelo, t.nombre as orden_taller,\r\n\t\t\te.descripcion as orden_estado, c.nombre as orden_cliente,\r\n\t\t\tv.dominio as orden_dominio,\r\n            od.id as od_id,\r\n            od.estado as od_estado,\r\n\t\t\tcase p.estado\r\n\t\t\t\twhen 1 then concat(p.id, ' - Pendiente')\r\n\t\t\t\twhen 2 then concat(p.id, ' - Aprobado')\r\n\t\t\t\twhen 3 then concat(p.id, ' - Rechazado')\r\n\t\t\t\telse 'Indefinido'\r\n\t\t\tend as presupuesto,\r\n            p.id as p_id,\r\n\t\t\tp.p_tipo,\r\n            cast(od1.fecha as date) as fecha,\n            cast(od1.fecha as time) as hora,\n            ifnull(`fn_orden_total_repuestos`(o.id), 0) + ifnull(`fn_orden_total_mano_obra`(o.id, if(@user_type = 2,2,1)),0) as total_orden\r\n\t\t\tfrom orden o\r\n\t\t\tjoin vehiculo v on v.id = o.vehiculo\r\n\t\t\tjoin cliente c on c.id = o.cliente\r\n\t\t\tjoin taller t on t.id = o.taller\r\n\t\t\tjoin marca m on m.id = v.marca\r\n\t\t\tjoin modelo d on d.id = v.modelo\r\n\t\t\tjoin zona z on z.id = o.zona\r\n            left outer join vw_orden_detalle od1 on od1.orden = o.id \r\n\t\t\t\tand od1.estado = 100\r\n\t\t\tleft outer join vw_orden_detalle od on od.orden = o.id\r\n\t\t\t\tand od.id = ($stmnt_od$)\r\n            left outer join vw_presupuesto p on p.orden = o.id\r\n\t\t\t\tand p.id = ($stmnt_p$)\r\n\t\t\tleft outer join estado e on e.id = od.estado", "$stmnt_p$", @stmnt_p), "$stmnt_od$", @stmnt_od);			

	end if;

	

	if @filter_text != "" then

		if @user_type = 1 then

			set @stmnt = replace(replace(concat(@stmnt, 

				" where c.id in \r\n\t\t\t\t\t(select \r\n\t\t\t\t\t\tcliente \r\n\t\t\t\t\t from \r\n\t\t\t\t\t\tusuario_cliente \r\n\t\t\t\t\t where \r\n\t\t\t\t\t\tusuario = $fuser$) \r\n\t\t\t\tand (o.referencia like '%$ftext$%'\r\n\t\t\t\tor m.marca like '%$ftext$%'\r\n\t\t\t\tor d.modelo like '%$ftext$%'\r\n\t\t\t\tor t.nombre like '%$ftext$%'\r\n\t\t\t\tor c.nombre like '%$ftext$%'\r\n\t\t\t\tor e.descripcion like '%$ftext$%'\r\n\t\t\t\tor v.dominio like '%$ftext$%'\r\n\t\t\t\tor z.nombre like '%$ftext$%'\r\n                or o.interno like '%$ftext$%'\r\n                or  \r\n\t\t\t\t\tcase p.estado\r\n\t\t\t\t\t\twhen 1 then 'Pendiente'\r\n\t\t\t\t\t\twhen 2 then 'Aprobado'\r\n\t\t\t\t\t\twhen 3 then 'Rechazado'\r\n\t\t\t\t\t\telse 'Indefinido'\r\n\t\t\t\t\tend like '%$ftext$%'\r\n                or cast(o.id as char(100)) like '%$ftext$%'\r\n                or cast(p.id as char(100)) like '%$ftext$%'\r\n                or o.factura like '%$ftext$%'\r\n                or o.observaciones like '%$ftext$%'\r\n                or cast(od1.fecha as char(100)) like '%$ftext$%'"),

				"$ftext$", @filter_text), "$fuser$", @user_id);

		elseif @user_type = 2 then

			set @stmnt = replace(replace(concat(@stmnt, 

				" where t.id in \r\n\t\t\t\t\t(select \r\n\t\t\t\t\t\ttaller\r\n\t\t\t\t\t from \r\n\t\t\t\t\t\tusuario_taller \r\n\t\t\t\t\t where \r\n\t\t\t\t\t\tusuario = $fuser$) \r\n\t\t\t\tand (o.referencia like '%$ftext$%'\r\n\t\t\t\tor m.marca like '%$ftext$%'\r\n\t\t\t\tor d.modelo like '%$ftext$%'\r\n\t\t\t\tor t.nombre like '%$ftext$%'\r\n\t\t\t\tor c.nombre like '%$ftext$%'\r\n\t\t\t\tor e.descripcion like '%$ftext$%'\r\n\t\t\t\tor v.dominio like '%$ftext$%'\r\n\t\t\t\tor z.nombre like '%$ftext$%'\r\n                or o.interno like '%$ftext$%'\r\n                or  \r\n\t\t\t\t\tcase p.estado\r\n\t\t\t\t\t\twhen 1 then 'Pendiente'\r\n\t\t\t\t\t\twhen 2 then 'Aprobado'\r\n\t\t\t\t\t\twhen 3 then 'Rechazado'\r\n\t\t\t\t\t\telse 'Indefinido'\r\n\t\t\t\t\tend like '%$ftext$%'\r\n                or cast(o.id as char(100)) like '%$ftext$%'\r\n                or cast(p.id as char(100)) like '%$ftext$%'\r\n                or o.factura like '%$ftext$%'\r\n                or o.observaciones like '%$ftext$%'\r\n                or cast(od1.fecha as char(100)) like '%$ftext$%')"),

				"$ftext$", @filter_text), "$fuser$", @user_id);

		else

			set @stmnt = replace(concat(@stmnt, 

				" where o.referencia like '%$ftext$%'\r\n\t\t\t\tor m.marca like '%$ftext$%'\r\n\t\t\t\tor d.modelo like '%$ftext$%'\r\n\t\t\t\tor t.nombre like '%$ftext$%'\r\n\t\t\t\tor c.nombre like '%$ftext$%'\r\n\t\t\t\tor e.descripcion like '%$ftext$%'\r\n\t\t\t\tor v.dominio like '%$ftext$%'\r\n\t\t\t\tor z.nombre like '%$ftext$%'\r\n                or o.interno like '%$ftext$%'\r\n                or  \r\n\t\t\t\t\tcase p.estado\r\n\t\t\t\t\t\twhen 1 then 'Pendiente'\r\n\t\t\t\t\t\twhen 2 then 'Aprobado'\r\n\t\t\t\t\t\twhen 3 then 'Rechazado'\r\n\t\t\t\t\t\telse 'Indefinido'\r\n\t\t\t\t\tend like '%$ftext$%'\r\n\t\t\t\tor cast(o.id as char(100)) like '%$ftext$%'\r\n                or cast(p.id as char(100)) like '%$ftext$%'\r\n                or o.factura like '%$ftext$%'\r\n                or o.observaciones like '%$ftext$%'\r\n                or cast(od1.fecha as char(100)) like '%$ftext$%'"),

				"$ftext$", @filter_text);

		end if;

	elseif @filter_field != "" and @filter_value != -1 then

		set @filtered = true;

		if @user_type = 1 then

			set @stmnt = concat(@stmnt, replace(" where c.id in \r\n\t\t\t\t  (select cliente from usuario_cliente where usuario = $fuser$)\r\n\t\t\t\t  and ", "$fuser$", @user_id), @filter_field, " = ?");

		elseif @user_type = 2 then

			set @stmnt = concat(@stmnt, replace(" where t.id in \r\n\t\t\t\t  (select taller from usuario_taller where usuario = $fuser$)\r\n\t\t\t\t  and ", "$fuser$", @user_id), @filter_field, " = ?");

		else

			set @stmnt = concat(@stmnt, " where ", @filter_field, " = ?");

		end if;

	else

		if @user_type = 1 then

			set @stmnt = concat(@stmnt, replace(" where c.id in \r\n\t\t\t\t  (select cliente from usuario_cliente where usuario = $fuser$)", 

				  "$fuser$", @user_id));

		elseif @user_type = 2 then

			set @stmnt = concat(@stmnt, replace(" where t.id in \r\n\t\t\t\t  (select taller from usuario_taller where usuario = $fuser$)", 

				  "$fuser$", @user_id));

		end if;		

	end if;

	

	

	if o_count != 1 then

		set @stmnt = concat(@stmnt, " group by o.id order by o.id desc limit ?,?;");

		prepare new_stmnt_2 from @stmnt;

		if @filtered then

			execute new_stmnt_2 using @filter_value, @startpos, @count;

		else

			execute new_stmnt_2 using @startpos, @count;

		end if;

		deallocate prepare new_stmnt_2;

	

	else

		prepare new_stmnt_2 from @stmnt;

		if @filtered then

			execute new_stmnt_2 using @filter_value;

		else

			execute new_stmnt_2;

		end if;

		deallocate prepare new_stmnt_2;

	end if;

	

	select @q into o_count;

END ;;
DELIMITER ;
