CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_orden_trabajo_select-list`(
	in p_orden int
)
BEGIN
	set @stmnt = "select * from orden_trabajo $where$";

	if p_cliente != 0 then
		set @stmnt = replace(@stmnt, "$where$", concat("where orden = ", p_orden)); 
	else
		set @stmnt = replace(@stmnt, "$where$", ""); 
	end if;

	prepare stmnt_2 from @stmnt;
	execute stmnt_2;
	deallocate prepare stmnt_2;
END ;;
