CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_orden_trabajo_select-range`(

	in p_startpos int, 

	in p_count int,

	in p_filter_field varchar(50),

	in p_filter_value int,

	in p_filter_text varchar(100),

	inout o_count int

)
BEGIN

	set @acount = o_count;



	set @filter_text = p_filter_text;



	if @acount = 1 then	

		set @ttable = "t1";

	else

		set @ttable = "t2";

	end if;



	set @stmnt = replace("create temporary table $table$ AS (\r\n\t\tselect * from vw_orden_trabajo $where$)", "$table$", @ttable);

 

	if @filter_text != "" then

		set @stmnt = replace(replace(@stmnt, "$where$", 

			" where trabajo like '%$ftext$%'"), "$ftext$", @filter_text);

	else

		set @stmnt = replace(@stmnt, "$where$", "");

	end if;



	prepare new_stmnt from @stmnt;

	execute new_stmnt;

	deallocate prepare new_stmnt;				



	call `sp_table_select-range`(

		@ttable,

		p_startpos,

		p_count,

		p_filter_field,

		p_filter_value,

		@acount);

	

	select @acount into o_count;

END ;;
