CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_orden_trabajo_update`(
	in p_id int,
	in p_orden int,
	in p_trabajo text,
	in p_tipo tinyint(1),
	in p_cantidad decimal(15,2),
	in p_observaciones text
)
BEGIN
	update orden_trabajo 
	set 
		orden = p_orden,
		trabajo = p_trabajo,
		tipo = p_tipo,
		cantidad = p_cantidad,
		observaciones = p_observaciones,
		fecha = CURRENT_TIMESTAMP
	where
		id = p_id;
END ;;
