CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_orden_update`(

	in p_id int,

	in p_vehiculo int,

	in p_cliente int,

	in p_taller int,

	in p_odometro int,

	in p_observaciones text,

	in p_referencia varchar(45),

	in p_zona int,

    in p_interno varchar(45),
    in p_costo_total decimal(15,2),

    in p_factura varchar(45)

)
BEGIN

	

	declare old_estado int;



	

	UPDATE `orden`

	SET

