CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presupuesto_costo_repuestos`(
	in p_orden_id int,
	in p_presupuesto_id int
)
BEGIN
	drop table if exists tbl_presupuesto_repuestos;		
	create temporary table tbl_presupuesto_repuestos as (
		select 
			orp.nombre,
			orp.valor,
			orp.cantidad,
			orp.tipo,
			case orp.tipo 
				when 0 then z.desc_1
				when 1 then z.desc_2
                when 2 then z.desc_3
				else z.desc_1
			end as descuento
		from orden_repuesto orp
		join orden o on o.id = orp.orden
				join zona z on z.id = o.zona
		where orp.orden = p_orden_id
	);
	
		insert into presupuesto_repuesto(presupuesto, repuesto, tipo, 
			cantidad, costo, descuento)
			select p_presupuesto_id, nombre, tipo, cantidad, valor, descuento
				from tbl_presupuesto_repuestos;
END ;;
