CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presupuesto_costo_repuestos_preview`(
	in p_orden_id int
)
BEGIN
		select 
			orp.nombre as repuesto,
			orp.valor as costo,
			orp.cantidad,
			case orp.tipo
				when 0 then 'O'
				when 1 then 'A'
                when 2 then 'X'
			else 'O'
			end as tipo, 
			case orp.tipo 
				when 0 then z.desc_1
				when 1 then z.desc_2
                when 2 then z.desc_3
				else z.desc_1
			end as descuento,
			case orp.tipo 
				when 0 then cast(valor * cantidad * (1 - z.desc_1 / 100) as decimal(15,2))
				when 1 then cast(valor * cantidad * (1 - z.desc_2 / 100) as decimal(15,2))
                when 2 then cast(valor * cantidad * (1 - z.desc_3 / 100) as decimal(15,2))
				else cast(valor * cantidad * (1 - z.desc_1 / 100) as decimal(15,2))
			end as valor
		from orden_repuesto orp
		join orden o on o.id = orp.orden
				join zona z on z.id = o.zona
		where orp.orden = p_orden_id;
END ;;
