CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presupuesto_costo_repuestos_stored`(
	in p_presupuesto_id int
)
BEGIN
	select
		repuesto,
        costo,
        cantidad,
        case tipo
			when 0 then 'O'
			when 1 then 'A'
            when 2 then 'X'
		else 'O'
		end as tipo,
        descuento,
        cast(costo * cantidad * (1 - descuento / 100) as decimal(15,2)) as valor
    from
		presupuesto_repuesto
    where
		presupuesto = p_presupuesto_id;
END ;;
