CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presupuesto_costo_trabajos`(
	in p_orden_id int,
	in p_costo int,
	in p_presupuesto_id int
)
BEGIN
	drop table if exists tbl_presupuesto_trabajos;		

	create temporary table tbl_presupuesto_trabajos as (
		select 
			ot.trabajo as trabajo, 
			t.id as tipo,
			ot.cantidad, 
			ot.observaciones,
			if (p_costo = 1, zt.costo1, zt.costo2) as costo
		from orden_trabajo ot
		join orden o on o.id = ot.orden
		join zona z on z.id = o.zona
		
		join zona_trabajo zt on zt.zona = z.id and ot.tipo = zt.trabajo
		join trabajo t on t.id = ot.tipo
		where ot.orden = p_orden_id
	);
	
		insert into presupuesto_trabajo (presupuesto, trabajo, tipo, cantidad,
			observaciones, costo)
			select p_presupuesto_id, trabajo, tipo, cantidad, observaciones,
				costo from tbl_presupuesto_trabajos;
END ;;
