CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presupuesto_costo_trabajos_preview`(
	in p_orden_id int,
	in p_costo int
)
BEGIN
		select 
			ot.trabajo, 
			case t.id
				when 1 then 'Mecanica'
				when 2 then 'Chapa'
				when 3 then 'Pintura'
			end as tipo, 
			ot.cantidad, 
			ot.observaciones,
			if (p_costo = 1, zt.costo1, zt.costo2) as costo,
			if (p_costo = 1, 
				cast(zt.costo1 * cantidad as decimal(15,2)), 
				cast(zt.costo2 * cantidad as decimal(15,2))) 
			as valor
		from orden_trabajo ot
		join orden o on o.id = ot.orden
		join zona z on z.id = o.zona
		
		join zona_trabajo zt on zt.zona = z.id and ot.tipo = zt.trabajo
		join trabajo t on t.id = ot.tipo
		where ot.orden = p_orden_id;
END ;;
