CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presupuesto_datos`(
	in p_id int
)
BEGIN
select 
	p.id,
	o.observaciones,
        case p.estado
			when 1 then 'Pendiente'
            when 2 then 'Aprobado'
            when 3 then 'Rechazado'            
            else 'Indefinido'
		end	as estado,
        DATE_FORMAT(fecha_generado,'%d-%m-%Y') as fecha_generado,
        DATE_FORMAT(fecha_actualizado, '%d-%m-%Y') as fecha_actualizado,
        o.id as o_id,
		o.referencia,
		o.odometro,
		t.nombre as taller_nombre,
		z.nombre as taller_zona,
		c.nombre as cliente_nombre, 
		concat(c.direccion, ' / ', c.localidad) as cliente_direccion, 
		c.cuit as cliente_cuit,
		m.modelo as vehiculo_modelo,
		v.dominio as vehiculo_dominio,
		v.anio as vehiculo_anio
	from presupuesto p
	join orden o on o.id = p.orden
	join vehiculo v on v.id = o.vehiculo
	join taller t on t.id = o.taller
	join cliente c on c.id = o.cliente
	join zona z on z.id = o.zona
	join modelo m on m.id = v.modelo
 
where p.id = p_id; 
END ;;
