	in p_costo int,
    in p_observaciones longtext,
    in p_usuario int,
	out p_id int
)
BEGIN

	declare exit handler for sqlexception, sqlwarning 
    begin
		resignal;
		rollback;
	end;
	
	start transaction;

	call sp_presupuesto_insert(p_orden, p_usuario, p_observaciones);
	
    set p_id = last_insert_id();

	call sp_presupuesto_costo_trabajos(p_orden, p_costo, p_id);
	call sp_presupuesto_costo_repuestos(p_orden, p_id);

    call `sp_orden_update-status`(p_orden, 101, p_observaciones, p_usuario);	

	commit;
END ;;
