	in p_user_id int,    
	inout o_count int
)
BEGIN
	set @acount = o_count;

	set @filter_text = p_filter_text;

	if @acount = 1 then	
		set @ttable = "t1";
	else
		set @ttable = "t2";
	end if;

	if p_user_type = 3 then
		set @stmnt = replace("create temporary table $table$ AS (
			select * from vw_presupuesto order by id desc)", "$table$", @ttable);
	elseif p_user_type = 2 then
		set @stmnt = replace("create temporary table $table$ AS (
			select * from vw_presupuesto where p_tipo = 1 order by id desc)", "$table$", @ttable);
    else        
		set @stmnt = replace("create temporary table $table$ AS (
			select * from vw_presupuesto where p_tipo = 2 order by id desc)", "$table$", @ttable);
	end if;
 
	prepare new_stmnt from @stmnt;
	execute new_stmnt;
	deallocate prepare new_stmnt;				

	call `sp_table_select-range`(
		@ttable,
		p_startpos,
		p_count,
		p_filter_field,
		p_filter_value,
		@acount);
	
	select @acount into o_count;
END ;;
