CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presupuesto_update-status`(
	in p_id int,
	in p_status int,
	in p_observaciones varchar(255),
    in p_usuario int
)
BEGIN
	declare exit handler for sqlexception, sqlwarning 
    begin
        resignal;
        rollback;
	end;
	start transaction;
	
	update 
		presupuesto 
	set 
		estado = p_status, 
        usuario_act = p_usuario,
        fecha_actualizado = NOW()
	where 
		id = p_id;
	
	select o.id from presupuesto p join orden o on o.id = p.orden where p.id = p_id into @orden;

	if p_status = 2 then
		call `sp_orden_presupuesto-ok`(@orden, p_observaciones, p_usuario);
	else
		call `sp_orden_presupuesto-nok`(@orden, p_observaciones, p_usuario);
	end if;

	commit;
END ;;
