CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_table_select-range`(
	in p_table varchar(50),
	in p_startpos int, 
	in p_count int,
	in p_filter_field varchar(50),
	in p_filter_value int,
	inout o_count int
)
BEGIN
	set @atable = p_table;
	set @startpos = p_startpos;
	set @count = p_count;
	set @filter_field = p_filter_field;
	set @filter_value = p_filter_value;
	set @filtered = false;
	set @q = o_count;
	
	
	if @q = 1 then
		set @stmnt = concat("select count(*) into @q from ", @atable);
	
	else
		set @stmnt = concat("select * from ", @atable);
		set @q = -1;
	end if;

	
	if @filter_field != "" and @filter_value != -1 then
		set @stmnt = concat(@stmnt, " where ", @filter_field, " = ?");
		set @filtered = true;
	end if;

	
	
	if o_count != 1 then
		set @stmnt = concat(@stmnt, " limit ?,?;");
		prepare new_stmnt_2 from @stmnt;
		if @filtered then
			execute new_stmnt_2 using @filter_value, @startpos, @count;
		else
			execute new_stmnt_2 using @startpos, @count;
		end if;
		deallocate prepare new_stmnt_2;
	
	else
		prepare new_stmnt_2 from @stmnt;
		if @filtered then
			execute new_stmnt_2 using @filter_value;
		else
			execute new_stmnt_2;
		end if;
		deallocate prepare new_stmnt_2;
	end if;
	
	select @q into o_count;
END ;;
